function Movie({ name, image }) {
  return <div>
    <h2>I like {name} movies!</h2>
    <img src={image} />
  </div>;
}

const movieILike = [
  { name: "horor", image: "https://i.ibb.co/frqPT76/In-The-Tall-Grass.jpg" },
  { name: "romance", image: "https://i.ibb.co/Lr4Cfmt/LaLaLand.jpg" },
  { name: "fantasy", image: "https://i.ibb.co/xqYFSCc/Harry-Potter.jpg" },
  { name: "comic", image: "https://i.ibb.co/gZkCGCj/Home-Alone.png" },
  { name: "thriller", image: "https://i.ibb.co/G9bFnrp/Orphan.jpg" }
];

function renderMovie(movie) {
  return <Movie name={movie.name} picture={movie.image} />;
}

function App() {
  return (
    <div className="App">
      {console.log(movieILike.map(renderMovie))}
    </div>
  );
}

export default App;
